import React from "react";

function Profile() {
  return (
    <div>
      <header className="bg-gradient-to-tr from-cyan-400-to py-4 px-5">
        Page Title
      </header>
      <body>
        <h1>My First Heading</h1>
        <p>My First Paragraph</p>
      </body>
    </div>
  );
}

export default Profile;
